import React from 'react';

//components
import Footer from './components/footer';

//libraries
import styled from 'styled-components';


//images
import logo from './logo.png';

//styles
import './App.css';

const H1 = styled.h1`

`;

const Code = styled.h2`
  font-style: italic;
`;

const App: React.FC = () => {
  return (
    <div className="App">
      <header className="App-header">
        <H1>Dominos Code Ireland</H1>
        <img src={logo} className="App-logo" alt="logo" />
        <p>Latest code: </p>
        <Code>JANDOM20</Code>
        <div className="row">
          <p>Developed by <a href="https://www.linkedin.com/in/stephen-byrne-429267167/" target="_blank" rel="noopener noreferrer"> Stephen Byrne </a>
          </p>
        </div>
      </header>
    </div>
  );
}

export default App;
